import React from 'react'
import { useSelector } from 'react-redux'
import { Navigate } from 'react-router-dom'

const Home = () => {

    const user = useSelector(state => state.user)

  return (
      user.isAuth
      ?
      <div>HOME</div>
      :
      <Navigate to="/login"></Navigate>
  )
}

export default Home
